import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Timeline.css';

function Timeline() {
  const [characterDetails, setCharacterDetails] = useState(null);
  const [characterFound, setCharacterFound] = useState(false);

  useEffect(() => {
    axios.get('https://genshinlist.com/api/characters')
      .then(response => {
        const dilucCharacter = response.data.find(character => character.name === 'Diluc');
        if (dilucCharacter) {
          setCharacterDetails(dilucCharacter);
          setCharacterFound(true);
        } else {
          console.log('Character not found');
          setCharacterFound(false);
        }
      })
      .catch(error => {
        console.log(error);
      });
  }, []);

  const renderTimeline = () => {
    if (!characterDetails || !characterFound) return null;

    const { birthday } = characterDetails;
    const currentYear = new Date().getFullYear();
    const birthYear = new Date(birthday).getFullYear();
    const age = currentYear - birthYear;

    const timelineItems = [];
    for (let year = birthYear; year <= currentYear; year++) {
      const itemText = `${year}: ${age} years old`;
      timelineItems.push(<div key={year} className="timeline-item">{itemText}</div>);
    }

    return timelineItems;
  };

  return (
    <div className="timeline-container">
      {renderTimeline()}
    </div>
  );
}

export default Timeline;
